VALUES ('4002671154637', 'Patros Ofen Genuss Pikant', 'PATROS OFEN GENUSS PIKANT Tütchen entnehmen, Folie von Patros Käse entfernen & Käse in die Aluschale geben. Beigelegtes Tütchen offnen & die Zutaten uber den Patros Käse streuen. Für ca. 12 min im Ofen (auf mittlerer Schiene bei ca. 210 C Umluft) zubereiten. Käse aus pasteurisierter Kuhmilch, in Salzlake gereift, 52% Fett i.Tr., mit einem Knusper-Topping zum Aufstreuen Zutaten: 90% Käse in Salzlake gereift, 10% Knusper-Top - ping (Cornflakes (Mais), Glukosesirup, Paprika, Chili, Zwiebeln, Gewürze, Rapsol, Kartoffelstärke, Petersilie) Für Vegetarier geeignet! Bei dem verwendeten Käse handelt es sich um ein Naturprodukt, daher kann sich Salzlake absetzen. pro 100g davon 90g Käne+ 10g Knusper-Topping) 1225 kl/295 kcal 23 g 15 g 7,2 g 1,8 g 14 g 2,8 g Durchschnittliche Nährwertangaben Brennwert Fett davon gesättizte Fettsäuren Kohlenhydrate davon Zucker Eiweiß Salz Bei +4 +8 Cmindestens haltbar bis: siehe Seite Genussvolle Rezepte unter www.patros.de Patros, Kemptener Straße 17 D\'88178 Heimnenkirch Käse 135 % 15 2 Knusper Topping 150g e 4 002671154637 49', 'https://static.openfoodfacts.org/images/products/400/267/115/4637/front_de.4.400.jpg', '23', '15', '7.2', '1.8', '', '14', '2.8', '1.10236220472441', '', '0');

